import React, { useState } from 'react';
import './menu.css';
import Product from './components/Product';
import Cart from './components/Cart';
import Modal from './components/Modal';
import DeliveryModal from './components/DeliveryModal';

function App() {
    const [cart, setCart] = useState([]);
    const [selectedProduct, setSelectedProduct] = useState(null);
    const [showCart, setShowCart] = useState(false);
    const [showDeliveryModal, setShowDeliveryModal] = useState(false);
    const [searchQuery, setSearchQuery] = useState('');
    const [filter, setFilter] = useState('tous');

    const products = [
        { id: 1, name: 'Spagetti', price: 15, category: 'traditionnel', imgSrc: '../image/menu-2.png' },
        { id: 2, name: 'Viande', price: 15, category: 'traditionnel', imgSrc: '../image/menu-3.png' },
        { id: 3, name: 'Sauce verte', price: 15, category: 'traditionnel', imgSrc: '../image/menu-4.png' },
        { id: 4, name: 'Riz blanc', price: 15, category: 'traditionnel', imgSrc: '../image/menu-5.png' },
        { id: 5, name: 'Plat Vegan', price: 10, category: 'vegan', imgSrc: 'vegan-dish.jpg' },
        { id: 6, name: 'Dessert', price: 5, category: 'dessert', imgSrc: 'dessert.jpg' }
    ];

    const filteredProducts = products.filter(
        product => (filter === 'tous' || product.category === filter) && product.name.toLowerCase().includes(searchQuery.toLowerCase())
    );

    const addToCart = (product, quantity) => {
        setCart(prevCart => {
            const existingProductIndex = prevCart.findIndex(item => item.id === product.id);
            if (existingProductIndex >= 0) {
                const updatedCart = [...prevCart];
                updatedCart[existingProductIndex].quantity += quantity;
                return updatedCart;
            } else {
                return [...prevCart, { ...product, quantity }];
            }
        });
    };


    const handleProductClick = product => {
        setSelectedProduct(product);
    };

    const handleCartToggle = () => {
        setShowCart(!showCart);
    };

    const handleDeliveryModalToggle = () => {
        setShowDeliveryModal(!showDeliveryModal);
    };

    return (
        <div className="App">
            <div className="top-bar-first-line">
                <div className="logo-line">
                    <img src="link_logo.png" alt="Logo Whilf Rede" />
                </div>
                <input
                    type="text"
                    className="search-bar"
                    placeholder="Rechercher..."
                    onChange={e => setSearchQuery(e.target.value)}
                />
                <div id="cart-icon-container" className="cart-icon" onClick={handleCartToggle}>
                    <i className="fas fa-shopping-cart"></i>
                    <span id="cart-count" className="cart-count">{cart.length}</span>
                </div>
            </div>
            <div className="separator"></div>
            <div className="top-bar-second-line">
                <div className="filter-container">
                    {['tous', 'traditionnel', 'vegan', 'dessert'].map(category => (
                        <button key={category} className="filter-button" onClick={() => setFilter(category)}>
                            {category.charAt(0).toUpperCase() + category.slice(1)}
                        </button>
                    ))}
                </div>
            </div>
            <div className="content">
                {filteredProducts.map(product => (
                    <Product key={product.id} product={product} onProductClick={handleProductClick} />
                ))}
            </div>

            {/* Overlay et modale pour le panier */}
            <div className={`cart-overlay ${showCart ? 'show' : ''}`} onClick={handleCartToggle}></div>
            <div className={`cart-container ${showCart ? 'show' : ''}`}>
                <Cart cart={cart} onClose={handleCartToggle} onProceedToDelivery={handleDeliveryModalToggle} />
            </div>

            {/* Modale pour les dÃ©tails du produit */}
            {selectedProduct && (
                <Modal product={selectedProduct} onClose={() => setSelectedProduct(null)} onAddToCart={addToCart} />
            )}

            {/* Modale pour les informations de livraison */}
            {showDeliveryModal && (
                <DeliveryModal onClose={handleDeliveryModalToggle} onConfirm={() => alert('Commande confirmÃ©e')} />
            )}
        </div>
    );
}

export default App;
